import React from "react";
import { Link } from "react-router-dom";

function CurrentEventCard(props) {
  const { id, cEventName, imageUrl, date, time } = props.currentEvent;
  return (
    <div className="card shadow bg-light h-100">
      <img className="card-img-top" src={imageUrl} alt={cEventName} />
      <div className="card-body">
        <h4 className="card-title">{cEventName}</h4>
        <p className="card-text">{date} {time}</p>
        <Link to={`/currentevent/${id}`} className="stretched-link"></Link>
      </div>
    </div>
  );
}

export default CurrentEventCard;
